            placeholder="Search here..."
          />
          {/* Replace with search icon */}
          <span className="absolute right-0 top-0 mt-3 mr-4">üîç</span>
        </div>
        {/* Notification and profile icons */}
        <span className="mr-4">üîî</span>
        <span>üë§</span>
      </div>
    </header>
  );
};

export default Header;
